import React, { useState } from 'react';
import styled from 'styled-components';

// 스타일드 컴포넌트로 더블 범위 슬라이더 스타일링
const RangeSlider = styled.input`
  width: 100%;
`;

function DoubleRangeInput() {
  // 상태 변수 설정
  const [minValue, setMinValue] = useState<number>(0);
  const [maxValue, setMaxValue] = useState<number>(100);

  // 최소값 입력이 변경될 때 호출되는 함수
  const handleMinInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const newMinValue = parseInt(event.target.value);
    setMinValue(newMinValue);
  };

  // 최대값 입력이 변경될 때 호출되는 함수
  const handleMaxInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const newMaxValue = parseInt(event.target.value);
    setMaxValue(newMaxValue);
  };

  return (
    <div>
      <RangeSlider
        type="range"
        min={0}
        max={100}
        value={minValue}
        onChange={handleMinInputChange}
      />
      <RangeSlider
        type="range"
        min={0}
        max={100}
        value={maxValue}
        onChange={handleMaxInputChange}
      />
      <p>최소 값: {minValue}</p>
      <p>최대 값: {maxValue}</p>
    </div>
  );
}

export default DoubleRangeInput;
